import Vue from 'vue'

import ThemeLayout from '@themeLayout'
import ThemeNotFound from '@themeNotFound'
import { injectMixins } from '@app/util'
import rootMixins from '@app/root-mixins'

injectMixins(ThemeLayout, rootMixins)
injectMixins(ThemeNotFound, rootMixins)

export const routes = [
  {
    name: "v-61d21211b105b",
    path: "/PROC-CONVERSION.html",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("/home/bparanj/work/bparanj.gitlab.io/docs/PROC-CONVERSION.md").then(comp => {
        Vue.component("v-61d21211b105b", comp.default)
        next()
      })
    }
  },
  {
    name: "v-9d4719737fb2",
    path: "/",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("/home/bparanj/work/bparanj.gitlab.io/docs/README.md").then(comp => {
        Vue.component("v-9d4719737fb2", comp.default)
        next()
      })
    }
  },
  {
    path: "/index.html",
    redirect: "/"
  },
  {
    name: "v-6b5ab1a0f9003",
    path: "/SOON.html",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("/home/bparanj/work/bparanj.gitlab.io/docs/SOON.md").then(comp => {
        Vue.component("v-6b5ab1a0f9003", comp.default)
        next()
      })
    }
  },
  {
    name: "v-5a553121c3841",
    path: "/about.html",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("/home/bparanj/work/bparanj.gitlab.io/docs/about.md").then(comp => {
        Vue.component("v-5a553121c3841", comp.default)
        next()
      })
    }
  },
  {
    name: "v-8bc9dd3df7444",
    path: "/credits.html",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("/home/bparanj/work/bparanj.gitlab.io/docs/credits.md").then(comp => {
        Vue.component("v-8bc9dd3df7444", comp.default)
        next()
      })
    }
